00015 namespace UnityEditor.Collaboration
00016 {
00017     internal class CollabHistoryItemFactory : ICollabHistoryItemFactory
00018     {
00019         const int k_MaxChangesPerRevision = 10;
00020 
00021         public IEnumerable<RevisionData> GenerateElements(IEnumerable<Revision> revisions, int totalRevisions, int startIndex, string tipRev, string inProgressRevision, bool revisionActionsEnabled, bool buildServiceEnabled, string currentUser)
00022         {
00023             int index = startIndex;
00024 
00025             foreach (var rev in revisions)
00026             {
00027                 index++;
00028                 var current = rev.revisionID == tipRev;
00029 
00030                 // Calculate build status
00031                 BuildState buildState = BuildState.None;
00032                 int buildFailures = 0;
00033                 if (rev.buildStatuses != null && rev.buildStatuses.Length > 0)
00034                 {
00035                     bool inProgress = false;
00036                     foreach (CloudBuildStatus buildStatus in rev.buildStatuses)
00037                     {
00038                         if (buildStatus.complete)
00039                         {
00040                             if (!buildStatus.success)
00041                             {
00042                                 buildFailures++;
00043                             }
00044                         }
00045                         else
00046                         {
00047                             inProgress = true;
00048                             break;
00049                         }
00050                     }
00051 
00052                     if (inProgress)
00053                     {
00054                         buildState = BuildState.InProgress;
00055                     }
00056                     else if (buildFailures > 0)
00057                     {
00058                         buildState = BuildState.Failed;
00059                     }
00060                     else
00061                     {
00062                         buildState = BuildState.Success;
00063                     }
00064                 }
00065                 else if (current && !buildServiceEnabled)
00066                 {
00067                     buildState = BuildState.Configure;
00068                 }
00069 
00070                 // Calculate the number of changes performed on files and folders (not meta files)
00071                 var paths = new Dictionary<string, ChangeData>();
00072                 foreach (ChangeAction change in rev.entries)
00073                 {
00074                     if (change.path.EndsWith(".meta"))
00075                     {
00076                         var path = change.path.Substring(0, change.path.Length - 5);
00077                         // Actions taken on meta files are secondary to any actions taken on the main file
00078                         if (!paths.ContainsKey(path))
00079                             paths[path] = new ChangeData() {path = path, action = change.action};
00080                     }
00081                     else
00082                     {
00083                         paths[change.path] = new ChangeData() {path = change.path, action = change.action};
00084                     }
00085                 }
00086 
00087                 var displayName = (rev.author != currentUser) ? rev.authorName : "You";
00088 
00089                 var item = new RevisionData
00090                 {
00091                     id = rev.revisionID,
00092                     index = totalRevisions - index + 1,
00093                     timeStamp = TimeStampToDateTime(rev.timeStamp),
00094                     authorName = displayName,
00095                     comment = rev.comment,
00096 
00097                     obtained = rev.isObtained,
00098                     current = current,
00099                     inProgress = (rev.revisionID == inProgressRevision),
00100                     enabled = revisionActionsEnabled,
00101 
00102                     buildState = buildState,
00103                     buildFailures = buildFailures,
00104 
00105                     changes = paths.Values.Take(k_MaxChangesPerRevision).ToList(),
00106                     changesTotal = paths.Values.Count,
00107                     changesTruncated = paths.Values.Count > k_MaxChangesPerRevision,
00108                 };
00109 
00110                 yield return item;
00111             }
00112         }
00113 
00114         private static DateTime TimeStampToDateTime(double timeStamp)
00115         {
00116             DateTime dateTime = new DateTime(1970, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc);
00117             dateTime = dateTime.AddSeconds(timeStamp).ToLocalTime();
00118             return dateTime;
00119         }
